import { expect } from "chai";
import getDefaultValue from "../getDefaultValue.mjs";
describe("Test getDefaultValueTest", function () {
  it("test with function", function () {
    var acture = getDefaultValue(function (v) {
      return v;
    }, "foo");
    expect(acture).to.equal("foo");
  });
  it("test with non funciton", function () {
    var acture = getDefaultValue("foo");
    expect(acture).to.equal("foo");
  });
  it("test with return current", function () {
    var acture = getDefaultValue(null, "foo");
    expect(acture).to.equal("foo");
  });
});